import React, { useState, useEffect } from "react";
import "./TimeWithAnimals.css";

const TimeWithAnimals = () => {
  const [formData, setFormData] = useState({
    name: "",
    email: "",
    phone: "",
    activity: "",
    date: "",
    time: "",
    message: "",
  });

  const [submitted, setSubmitted] = useState(false);

  useEffect(() => {
    window.scrollTo(0, 0);
  }, []);

  const handleChange = (e) => {
    setFormData({
      ...formData,
      [e.target.name]: e.target.value,
    });
  };

  const handleSubmit = (e) => {
    e.preventDefault();
    console.log("Formularz wysany:", formData);
    setSubmitted(true);
    setFormData({
      name: "",
      email: "",
      phone: "",
      activity: "",
      date: "",
      time: "",
      message: "",
    });
  };

  return (
    <section
      className="time-section"
      style={{
        backgroundImage: "url(/img/time-with-dog.jpg)",
        backgroundSize: "cover",
        backgroundPosition: "center",
      }}
    >
      <div className="time-overlay"></div>

      <div className="time-container">
        <h1>Spd藕 czas ze zwierzakiem</h1>
        <p>
          Nie musisz by wolontariuszem, aby pom贸c naszym podopiecznym. 
          Mo偶esz um贸wi si na spacer, zabaw z kotem, sprztanie boks贸w 
          lub po prostu przyj na chwil towarzystwa.
        </p>

        <div className="time-form">
          <h2>Um贸w wizyt</h2>

          {submitted ? (
            <div className="form-success">
              <p>Dzikujemy! Twoje zgoszenie zostao wysane </p>
            </div>
          ) : (
            <form onSubmit={handleSubmit}>
              <label>Imi i nazwisko:</label>
              <input
                type="text"
                name="name"
                value={formData.name}
                onChange={handleChange}
                required
              />

              <label>Email:</label>
              <input
                type="email"
                name="email"
                value={formData.email}
                onChange={handleChange}
                required
              />

              <label>Telefon (opcjonalnie):</label>
              <input
                type="tel"
                name="phone"
                value={formData.phone}
                onChange={handleChange}
              />

              <label>Wybierz aktywno:</label>
              <select
                name="activity"
                value={formData.activity}
                onChange={handleChange}
                required
              >
                <option value="">-- wybierz --</option>
                <option value="spacer">Spacer z psem</option>
                <option value="zabawa">Zabawa z kotem</option>
                <option value="sprzatanie">Sprztanie boks贸w</option>
                <option value="inne">Inne</option>
              </select>

              <label>Wybierz dzie:</label>
              <input
                type="date"
                name="date"
                value={formData.date}
                onChange={handleChange}
                required
              />

              <label>Wybierz godzin:</label>
              <input
                type="time"
                name="time"
                min="10:00"
                max="18:00"
                value={formData.time}
                onChange={handleChange}
                required
              />

              <label>Uwagi / wiadomo:</label>
              <textarea
                name="message"
                rows="4"
                value={formData.message}
                onChange={handleChange}
                placeholder="Napisz kilka s贸w, np. kt贸re zwierz chcesz odwiedzi..."
              ></textarea>

              <button type="submit">Wylij zgoszenie</button>
            </form>
          )}
        </div>
      </div>
    </section>
  );
};

export default TimeWithAnimals;
